    false,nt"url": null,nt"notes": "This is the 1985 prescribed burning plan
    for Parker River National Wildlife Refuge.  Treatment Area #3 is the area consisting
    of the fresh water marsh inside the Stage Island Pool.  The purpose of the prescribed
    burn is to remove past years' accumulation of dead organic matter, releasing the
    nutrients back into the soil and allowing sun's light to stimulate early plant growth.
    This prescribed burn is an integral part of the lead shot reduction plan scheduled
    to start during summer of 1985.  The primary (95 percent) fuels to be burned are
    Giant Reed; Purple Loosestrife; and Common Cattail. These fine to light fuels are
    found in pure species stands or in varying density combinations with one another.",nt"owner_org":
